<html>
<head>
    <meta charset="UTF-8">
    <meta name="robots" content="noindex,nofollow,noarchive,nosnippet,noodp,noydir">
    <title>Avg Time in μs / Request by second</title>
    <link href="https://ajax.googleapis.com/ajax/static/modules/gviz/1.0/core/tooltip.css" rel="stylesheet" type="text/css">
</head>
<body>
    <script type="text/javascript" src="https://www.google.com/jsapi"></script>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/2.1.3/jquery.min.js"></script>
    <script type="text/javascript">
        $(window).resize(function() {
            drawChart();
        });
        
        google.load('visualization', '1.0', {
            'packages': ['corechart']
        });
        
        google.setOnLoadCallback(drawChart);
        
        
        
        function drawChart() {
			
            var data = google.visualization.arrayToDataTable([["Argument", "Average"],[102940.96,9.64],[103250.65,19.85],[103551.11,28.63],[103555.91,41.02],[103696.45,48.68],[103711.54,59.05],[104080.73,67.72],[104462.64,77.63],[104636.81,85.10],[104647.96,96.68],[105490.44,105.15],[104748.20,117.02],[104968.75,121.57],[104704.08,135.58],[105376.38,138.80]]);
            
            var options = {
                title: 'Avg Time in μs \/ Request by second',
                curveType: 'function',
                legend: {
                    position: 'bottom'
				},
				interpolateNulls: true
            };
            
            var chart = new google.visualization.LineChart(document.getElementById('chart_div'));
            chart.draw(data, options);
        }
    </script>
    <script src="https://www.google.com/uds/?file=visualization&amp;v=1.0&amp;packages=corechart" type="text/javascript"></script>
    <link href="https://www.google.com/uds/api/visualization/1.0/40ff64b1d9d6b3213524485974f36cc0/ui+en.css" type="text/css" rel="stylesheet">
    <script src="https://www.google.com/uds/api/visualization/1.0/40ff64b1d9d6b3213524485974f36cc0/format+en,default+en,ui+en,corechart+en.I.js" type="text/javascript"></script>
    <div id="chart_div" style="height:600px;width:100%;"></div>
</body>
</html>
